  true,\n\t\"url\": null,\n\t\"notes\": \"This annual publication focuses on the Social
  Security beneficiary population people receiving Old-Age, Survivors, and Disability
  Insurance (OASDI) benefits at the local level. It presents basic program data on
  the number and type of beneficiaries and the amount of benefits paid in each state
  and county. It also shows the numbers of men and women aged 65 or older receiving
  benefits. The data include only persons whose benefits are currently payable. Report
  for 2007.\",\n\t\"license_title\": \"Creative Commons CCZero\",\n\t\"extras\": [{\n\t\t\"key\":
